class GestionarMesasComponent {
    constructor(database, route) {
        this.database = database;
        this.route = route;
        this.items = [];
        this.is_loading = true;
        this.show_nuevo = false;
        this.is_nuevo_loading = false;
        this.nuevo = "";
    }
    ngOnInit() {
        this.empresa_id = this.route.snapshot.paramMap.get('id');
        this.subscribe_01 = this.database.get_mesas_empresas(this.empresa_id).subscribe((response) => {
            this.items = response.reverse();
            this.is_loading = false;
        });
    }
    ngOnDestroy() {
        if (this.subscribe_01 !== null && this.subscribe_01 !== undefined) {
            this.subscribe_01.unsubscribe();
        }
    }
    eliminar(item) {
        var opcion = confirm("Eliminar?");
        if (opcion == true) {
            this.database.delete_mesa(item);
        }
        else {
            console.log("Cancelar");
        }
    }
    editar(item) {
        item.edit = true;
    }
    cancel(item) {
        item.edit = false;
    }
    guardar(item) {
        let nombre = document.getElementById(item.id).value;
        if (nombre !== "") {
            item.nombre = nombre;
            this.database.update_mesa(item)
                .then(() => {
                console.log("Actualizado");
                item.edit = false;
            })
                .catch((error) => {
                console.log("error", error);
                item.edit = false;
            });
        }
        else {
        }
    }
    cancel_nuevo() {
        this.show_nuevo = false;
        this.nuevo = "";
    }
    guardar_nuevo() {
        if (this.nuevo != "") {
            this.is_nuevo_loading = true;
            let item = {
                id: this.database.createId(),
                empresa_id: this.empresa_id,
                nombre: this.nuevo,
                habilitado: true,
                fecha_agregada: new Date().toISOString()
            };
            this.database.add_mesa(item)
                .then(() => {
                this.nuevo = "";
                this.show_nuevo = false;
                this.is_nuevo_loading = false;
            })
                .catch(error => {
            });
        }
        else {
        }
    }
    agregar_nuevo() {
        this.show_nuevo = true;
    }
}
